import React from 'react';
import Navbar from './components/Navbar';
import Jumbotron from './components/Jumbotron';
import Projects from './components/Projects';
import About from './components/About';

function App() {
  return (
    <div>
      <Navbar />
      <Jumbotron />
      <About />
      <Projects />
    </div>
  );
}

export default App;
